import React, {FC} from 'react'
import Button from "@material-ui/core/Button";
import {AppBar, Container, Toolbar, Box, TextField} from "@material-ui/core";
import './style.css'
import {BatteryUnknown} from "@material-ui/icons";



const Navbar = () =>{

    return(
        <AppBar className={"navBar"} >
            <Container >
                <Toolbar className={'toolBar'}>
                    <Box>
                        <Button>HELP</Button>
                    </Box>

                    <Box className={'box'}>
                        <Button className={'navBar-btn'}>Регистрация</Button>
                        <Button className={'navBar-btn'}>Авторизация</Button>
                    </Box>
                </Toolbar>
            </Container>
        </AppBar>
    )
}
export default Navbar;
